import React from "react";
import Collapsible from "react-collapsible";

const CollapsibleGroup = () => {
  return (
    <div>
      <div className="container">
        <div className="row">
          {/* Left section */}
          <div className="col-md-6 d-flex justify ">Left</div>

          {/* Right section */}
          <div className="col-md-6 d-flex justify ">Right</div>
        </div>
      </div>

      <Collapsible trigger="What is PMS?">
        <p>
          Property Management Systems or Hotel Operating System, under business,
          terms may be used in real estate, manufacturing, logistics,
          intellectual property, government, or hospitality accommodation
          management.
        </p>
      </Collapsible>
    </div>
  );
};

export default CollapsibleGroup;
